import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes, Link, useParams, useNavigate, useLocation } from 'react-router-dom';
import axios from 'axios';
import FinalizeFinance from "./financeFinalization";
import './App.css';
import { API_BASE_URL } from './api';

export default function FinanceApp () {
    const navigate = useNavigate();
    const location = useLocation();
    const { userData, carInfos } = location.state;
    const [error, setError] = useState('');
    const [ income, setIncome ] = useState('');
    const [socialSecurity, setSocialSecurity] = useState(userData.social_security);
    const [ financeTerms, setFinanceTerms ] = useState({});

    useEffect(() => {
      window.scrollTo({ top: 0 });
    }, []);

    

    let finTerms = {};

    //useEffect(() => {
      //  console.log('financeTerms:', financeTerms);
    //}, [financeTerms]);

    const sendFinanceApp = async (e) => {
        e.preventDefault();

        const formData = {
            full_name: `${userData.first_name} ${userData.last_name}`,  
            customer_id: userData.customer_id, 
            annual_income: income,
            make: carInfos.make,
            model: carInfos.model,
            car_year: carInfos.year,
            purchase_price: carInfos.price,
            vin: carInfos.car_id,
            social_security: socialSecurity
        };

        try {
            const response = await axios.post('${API_BASE_URL}/receiveFinanceApp', formData)
            
            if (response.status === 200 || response.status === 201) {
              console.log("Response data: ", response.data);
              setFinanceTerms(response.data);
              console.log("State before navigation: ", { financeTerms, userData, carInfos });
            } else {
              setError('Failed to sent finance application');
            }
        } catch (error) {
            console.error('Error:', error);
        }


    };

    useEffect(() => {
      if (Object.keys(financeTerms).length !== 0) {
        console.log("State right before nav:", { financeTerms, userData, carInfos });
        navigate('/finalizeFinance', {
          state: { financeTerms, userData, carInfos },
        });
      }
    }, [financeTerms, userData, carInfos]);
    
    return (
          <div id="finAppBg">
              <span><svg xmlns="http://www.w3.org/2000/svg" width="250" height="200" fill="none" viewBox="0 0 284 225">
                  <path fill="url(#a)" d="M0-59h284v284H0z"/>
                  <defs>
                    <pattern id="a" width="1" height="1" patternContentUnits="objectBoundingBox">
                      <use href="#b" transform="scale(.00093)"/>
                    </pattern>
                    <image id="b" width="1080" height="1080" data-name="Velocity Motors Logo.png" href="data:image/png;base64,"/>
                  </defs>
                </svg>
              </span>
              <div id="finAppFormContainer">
                  <form id="financeForm" onSubmit={sendFinanceApp}>
                      <center><h2 id="financeTitle">Finance Application</h2></center>
                      <label htmlFor="full_name">Full Name:</label><br />
                      <input type="text" id="full_name" name="full_name" readOnly value={`${userData.first_name} ${userData.last_name}`} /><br /><br />

                      <label htmlFor="customer_id">Customer ID:</label><br />
                      <input type="number" id="customer_id" name="customer_id" readOnly value={`${userData.customer_id}`} /><br /><br />

                      <label htmlFor="annual_income">Annual Income:</label><br />
                      <input type="number" id="annual_income" name="annual_income" value={income} onChange={(e) => setIncome(e.target.value)} /><br /><br />

                      <label htmlFor="vehicle_make_and_model">Vehicle Make and Model:</label><br />
                      <input type="text" id="vehicle_make_and_model" name="vehicle_make_and_model" readOnly value={`${carInfos.make} ${carInfos.model}`} /><br /><br />

                      <label htmlFor="year_of_the_car">Year of the Car:</label><br />
                      <input type="number" id="year_of_the_car" name="year_of_the_car" readOnly value={`${carInfos.year}`} /><br /><br />

                      <label htmlFor="purchase_price">Purchase Price:</label><br />
                      <input type="text" id="purchase_price" name="purchase_price" readOnly value={`$${carInfos.price}`} /><br /><br />

                      <label htmlFor="vin_number">Vehicle Identification Number (VIN):</label><br />
                      <input type="number" id="vin_number" name="vin_number" readOnly value={`${carInfos.car_id}`} /><br /><br />

                      <label htmlFor="social-security">Social Security Number:</label><br />
                      <input type="text" id="social-security" name="social-security" placeholder="i.e. 555-55-5555" pattern="\d{3}-?\d{2}-?\d{4}" readOnly={userData.social_security!== ''} value={`${userData.social_security}`} onChange={(e) => setSocialSecurity(e.target.value)}  /><br /><br />

                      <center id="finButtonDiv">
                          <input id="financeSubmit" type="submit" value="Submit" />
                      </center>
                  </form> 
              </div>
              <Routes>
                  <Route path="/finalizeFinance" element={<FinalizeFinance />} />
              </Routes>
          </div>
    );
}